import React, { Component } from "react";
import './AhyUs.css'
import Slider from "react-slick";
import IMG from '../assets/psychiatristportfolio4.jpg'
import IMG2 from '../assets/psychiatristportfolio6.jpg'
import IMG3 from '../assets/psychiatristportfolio8.jpg'

function CustomSlide(props) {
  const { index, ...otherProps } = props;
  return (
    <div {...otherProps}>
      <h3>{index}</h3>
    </div>
  );
}

function CustomSlides() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };
  return (
    <div className="story">
       <div className="slider-container">
      <Slider {...settings}>
        <CustomSlide index={1} />
        <CustomSlide index={2} />
        <CustomSlide index={3} />
        <CustomSlide index={4} />
        <CustomSlide index={5} />
        <CustomSlide index={6} />
      </Slider>
    </div>
    </div>
   
  );
}

export default CustomSlides;
